import React, { useState, useEffect } from "react";
import { useParams ,NavLink } from "react-router-dom";

import style from "../StudentDashboard.module.css";

function Exam() {
    let { category } = useParams();

    // Mock data for exams
    const mockExams = [
        { id: 1, name: "Maths", desc: "Mathematics Exam", passMarks: 40, marks: 100 },
        { id: 2, name: "Physics", desc: "Physics Exam", passMarks: 45, marks: 100 },
        { id: 3, name: "Chemistry", desc: "Chemistry Exam", passMarks: 50, marks: 100 },
    ];

    // Filter exams based on category
    const filteredExams = mockExams.filter(exam => exam.name === category);

    return (
        <>
            <div id={style.displayBoxHeadingBox}>
                <h1>All {category} Exam</h1>
            </div>
            {
                filteredExams.map((exam, index) => (
                    <div id={style.displayBoxExamBox} key={index}>
                        <div id={style.div1}> <span>{exam.name}</span> </div>
                        <div id={style.div2}> <span>Exam ID: {exam.id}</span> </div>
                        <div id={style.div2}> <span>Exam Description: {exam.desc}</span> </div>
                        <div id={style.div3}><span>Pass Marks:{exam.passMarks}</span> </div>
                        <div id={style.div4}><span>Total Marks:{exam.marks}</span></div>
                        <div id={style.div5}>
                            <NavLink exact to={`/StudentDashboard/Exam/${exam.name}/${exam.id}`}>
                                <button>Go to Exam</button>
                            </NavLink>
                        </div>
                    </div>
                ))
            }
        </>
    );
}

export default Exam;
